import React from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import { Button, buttonStyle } from '../shared/Button';
import Title from './Title';
import GoogleSignIn from '../GoogleSignIn';
import {
	StyledLink,
	TransparentButton,
	HeaderDiv,
	NavDiv,
	NavRightDiv
} from './styles';

const Header = (props) => {
	const renderName = () => {
		if (props.name) {
			return (
				<div className="user">
					<i className="fas fa-user" />
					{props.name}
					<div className="vl" />
				</div>
			);
		} else return null;
	};

	return (
		<HeaderDiv className="header ui-container">
			<Title />
			<NavDiv className="nav">
				{renderName()}
				<StyledLink to="/" className="transparent">
					Journals
				</StyledLink>
				<NavRightDiv className="nav-right">
					<TransparentButton>
						<i className="fas fa-cog" />Settings
					</TransparentButton>
					<GoogleSignIn />
				</NavRightDiv>
			</NavDiv>
		</HeaderDiv>
	);
};

